import styled from "styled-components";
import { Link } from "react-router-dom";
import { Amazon_Logo } from "../../assets/Images";
import LocationOnOutlinedIcon from "@mui/icons-material/LocationOnOutlined";
import TopNavSearch from "./TopNavSearch";

const TopNav = () => {
  return (
    <TopNavContainer className="flex">
      <TopNavLeft className="flex">
        <div className="nav__logo nav--hover ">
          <Link to={"/"} className="flex">
            <img src={Amazon_Logo} alt="Amazon Logo" /> .in
          </Link>
        </div>
        <div className="nav__address nav--hover">
          <Link to={"/"} className="flex-column">
            <span className="nav__address__first">Hello</span>
            <span className="nav__address__second">
              <LocationOnOutlinedIcon />
              Select your address
            </span>
          </Link>
        </div>
      </TopNavLeft>
      <TopNavMiddle></TopNavMiddle>
      <TopNavRight></TopNavRight>
    </TopNavContainer>
  );
};

export default TopNav;

const TopNavContainer = styled.nav`
  align-items: center;
  background-color: rgb(14, 12, 41);
  padding: 0.4rem 0.8rem;
`;
const TopNavLeft = styled.div`
  align-items: center;
  /* NavLogo */
  .nav__logo {
    padding: 0.7rem 0.4rem 0.2rem;
    img {
      width: 7rem;
      height: 2rem;
    }
  }
  /* Nav Address */
  .nav__address {
    justify-content: center;
    .nav__address__first {
      margin-left: 1.5rem;
      font-size: 0.75rem;
      color: #cecaca;
    }
    .nav__address__second {
      margin-top: -10px;
      font-size: .9rem;
      font-weight: 500;
    }
  }
`;
const TopNavMiddle = styled.div``;
const TopNavRight = styled.div``;
